import { Outlet } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";
import classes from "./Root.module.css";

function RootLayout() {
  return (
    <>
      <main>
        <Outlet className={classes.content} />
      </main>
    </>
  );
}

export default RootLayout;
